import React, {Fragment, useEffect} from 'react';

const Greeting = (props) => {

    let obtainData = (id) => {
        let crude = fetch('https://jsonplaceholder.typicode.com/users').then(r => r.json).then(r => console.log(r[0]));
        return crude
    }


    let name = useEffect(async () => await obtainData(), [])

    return(
        <Fragment>
            hello! {name}
        </Fragment>
    )
}

export default Greeting;
